import React from 'react'

function Arrange(props) {
    const items=props.items;
    const listItems=items.map(item => {
        return <div className="list" key={item.key}>
            <p>{item.text}
            <span>

            </span></p>

        </div>
    })
    return(
        <div>{listItems}</div>
    )
}



export default Arrange
